import Header from '../components/Header'
import Logo from '../components/Logo/Logo'
import '../App.css'

import Auto from "../components/Auto/Auto";

function Auth() {

  return (
    <div className="Login">
      <div className='header'>
      <Header/>
      </div>
      <div className='Logo'>
        <Logo/>
        </div>
        <div className='content'>
        <Auto/>
        </div>



    </div>
  );
}

export default Auth;
